import React, {useState} from "react";
import "./App.css";
import countries from "./api/countries.json";
import {CountryInfo, getCountryByName} from "./api/apiService";

function App() {

  const [sortCountries, setSortCountries] = useState<CountryInfo[]>([])

  const abc = async (e: any) => {
    const countries = await getCountryByName(e.target.value)
    setSortCountries(countries)
    console.log(countries)
  }

  return (
    <div>
      <input type="text" onChange={abc}/>
      <>
        {
          sortCountries?.map((el, ind) => {
            <div key={ind}>
              <p>{el.name}</p>
            </div>
          })
        }
      </>

    </div>
    )

}

export default App;
